  const { id } = useParams();
  console.log(id);
  useEffect(() => {
    dispatch(fetchAuthMe(id));
  }, []);
  const { posts } = useSelector((state) => state.posts);
  return (
    <>
      <div>UsrePage</div> <span>{id}</span>
    </>
  );
}
